import React from 'react';
import styles from './Menu.module.css';
import Social from './Social';
import Image from 'next/image';
import { motion } from 'framer-motion';

const Menu = () => {
  return (
    <div className={styles.welcomeMenu}>
      <div className={styles.logo}>
        <Image src="/restologo.jpeg" alt="logo" width={150} height={150} />
      </div>
      <div className={styles.menu}>
        <div className={styles.menuTitle}>Menu</div>
        <ul role="navigation">
          <li>
            <motion.a
              whileHover={{
                color: 'red',
              }}
              href="#"
            >
              <span aria-label="restaurant menu">Menu</span>
            </motion.a>
          </li>
          <li>
            <motion.a
              whileHover={{
                color: 'red',
              }}
              href="#"
            >
              Waitlist
            </motion.a>
          </li>
          <li>
            <motion.a
              whileHover={{
                color: 'red',
              }}
              href="#"
            >
              Gift Cards
            </motion.a>
          </li>
          <li>
            <motion.a
              whileHover={{
                color: 'red',
              }}
              href="#"
            >
              Offers
            </motion.a>
          </li>
        </ul>
      </div>
      <Social />
    </div>
  );
};

export default Menu;
